import { STRING_CONSTANTS } from 'shared/constants/stringConstants';

const getAllKeysInArrayFormat = obj => Object.keys(obj).map(function(key) {
    return obj[key];
});

export const PROD_COMMONS = getAllKeysInArrayFormat(STRING_CONSTANTS.DATA_ATTRIBUTES.PROD_COMMONS);
export const PROD_ACTION_FIGURES = getAllKeysInArrayFormat(STRING_CONSTANTS.DATA_ATTRIBUTES.PROD_ACTION_FIGURES);
export const PROD_MOVIES = getAllKeysInArrayFormat(STRING_CONSTANTS.DATA_ATTRIBUTES.PROD_MOVIES);
export const PROD_VIDEO_GAMES = getAllKeysInArrayFormat(STRING_CONSTANTS.DATA_ATTRIBUTES.PROD_VIDEO_GAMES);
export const PROD_LEGOS = getAllKeysInArrayFormat(STRING_CONSTANTS.DATA_ATTRIBUTES.PROD_LEGOS);

const PROD_ACTION_FIGURES_NON_SORTABLE = getAllKeysInArrayFormat(STRING_CONSTANTS.DATA_ATTRIBUTES.PROD_ACTION_FIGURES_NON_SORTABLE);
export const ALL_ACTION_FIGURE_ATTRIBUTES = PROD_COMMONS.concat(PROD_ACTION_FIGURES).concat(PROD_ACTION_FIGURES_NON_SORTABLE);


export const DATA_ATTRIBUTES = STRING_CONSTANTS.DATA_ATTRIBUTES;
export const BUTTONS = STRING_CONSTANTS.BUTTONS;
export const FILTER_LABELS = STRING_CONSTANTS.BUTTONS.FILTER_LABELS;
export const IMAGES = STRING_CONSTANTS.IMAGES;

export const SORT_DIRECTION = STRING_CONSTANTS.SORT.DIRECTION;
